import React from "react";
import {Grid, AppBar, Menu} from "@material-ui/core";

export default function Header() {

    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
    };
    return (

        <AppBar>
            <Grid container direction="row" justify="space-around" alignItems="center">

                <Grid item xs={6}>
                    Bild
                </Grid>

                <Grid item xs={6}>
                    <h1>Jokes sind meist ganz funny</h1>
                </Grid>
            </Grid>
            <Menu
                id="simple-menu"
                anchorEl={anchorEl}
                keepMounted
                open={Boolean(anchorEl)}
                onClose={handleClose}
            ></Menu>


        </AppBar>


    );
}
